import { configureStore } from "@reduxjs/toolkit";

import FetchReducer from "./FetchSlice";
import FormReducer from "./FormSlice";
import authReducer from "./authSlice";

export default configureStore({
  reducer: {
    auth: authReducer,
    forms: FormReducer,
    fetch_app: FetchReducer,
  },
});
